import React from "react";

function Chess() {
    return (
        <div className="Chess">
            <h3>Chess</h3>
            <img className="chessimg" src="https://www.shutterstock.com/image-vector/set-black-chess-pieces-piece-260nw-1410268910.jpg"   />
        </div>
    );
}

export default Chess;
